export class MonsterMaroonUniformPack extends BaseNeckProvider implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => MonsterMaroonUniformPack.decorateUniformSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.MonsterMaroon)
                + (this.isEnlisted(token) ? MonsterMaroon.averageMaleBodyEnlisted : MonsterMaroon.averageMaleBody), BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => MonsterMaroonUniformPack.decorateUniformSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.MonsterMaroon)
                + (this.isEnlisted(token) ? MonsterMaroon.averageFemaleEnlistedBody : MonsterMaroon.averageFemaleBody), BodyType.AverageFemale, token), "BodyType.averageFemale"),
        ];
    }

    getRankSwatches() {
        return [
            new Swatch(Rank.None, "None", (token) => MonsterMaroonUniformPack.decorateRankSwatch("", Rank.None, token), "Rank.none.name"),
            new Swatch(Rank.Ensign, "Ensign", (token) => MonsterMaroonUniformPack.decorateRankSwatch(MonsterMaroonEnsignBorder, Rank.Ensign, token, MonsterMaroonEnsignBorderGradient), "Rank.ensign.name"),
            new Swatch(Rank.LieutenantJG, "Lieutenant J.G.", (token) => MonsterMaroonUniformPack.decorateRankSwatch(MonsterMaroonLieutenantJGBorder, Rank.LieutenantJG, token, MonsterMaroonLieutenantJGBorderGradient), "Rank.lieutenantJG.name"),
            new Swatch(Rank.Lieutenant, "Lieutenant", (token) => MonsterMaroonUniformPack.decorateRankSwatch(MonsterMaroonLieutenantBorder, Rank.Lieutenant, token, MonsterMaroonLieutenantBorderGradient), "Rank.lieutenant.name"),
            new Swatch(Rank.LtCommander, "Lt. Commander", (token) => MonsterMaroonUniformPack.decorateRankSwatch(MonsterMaroonLtCommanderBorder, Rank.LtCommander, token, MonsterMaroonLtCommanderBorderGradient), "Rank.ltCommander.name"),
            new Swatch(Rank.Commander, "Commander", (token) => MonsterMaroonUniformPack.decorateRankSwatch(MonsterMaroonCommanderBorder, Rank.Commander, token, MonsterMaroonCommanderBorderGradient), "Rank.commander.name"),
            new Swatch(Rank.Captain, "Captain", (token) => MonsterMaroonUniformPack.decorateRankSwatch(MonsterMaroonCaptainBorder, Rank.Captain, token, MonsterMaroonCaptainBorderGradient), "Rank.captain.name"),

            new Swatch(Rank.Crewman3rdClass, "Crewman, 3rd Class", (token) => MonsterMaroonUniformPack.decorateRankSwatch("", Rank.Crewman3rdClass, token, ""), "Rank.crewman3rdClass.name"),
            new Swatch(Rank.Crewman2ndClass, "Crewman, 2nd Class", (token) => MonsterMaroonUniformPack.decorateRankSwatch("", Rank.Crewman2ndClass, token, ""), "Rank.crewman2ndClass.name"),
            new Swatch(Rank.Crewman1stClass, "Crewman, 1st Class", (token) => MonsterMaroonUniformPack.decorateRankSwatch(Crewman1stClassBorderRank, Rank.Crewman1stClass, token, Crewman1stClassBorderGradient), "Rank.crewman1stClass.name"),
            new Swatch(Rank.PettyOfficer2ndClass, "Petty Officer, 2nd Class", (token) => MonsterMaroonUniformPack.decorateRankSwatch(PettyOfficer2ndClassRank, Rank.PettyOfficer2ndClass, token, PettyOfficer2ndClassBorderGradient), "Rank.pettyOfficer2ndClass.name"),
            new Swatch(Rank.PettyOfficer1stClass, "Petty Officer, 1st Class", (token) => MonsterMaroonUniformPack.decorateRankSwatch(PettyOfficer1stClassRank, Rank.PettyOfficer1stClass, token, PettyOfficer1stClassBorderGradient), "Rank.pettyOfficer1stClass.name"),
            new Swatch(Rank.ChiefPettyOfficer, "Chief Petty Officer", (token) => MonsterMaroonUniformPack.decorateRankSwatch(ChiefPettyOfficer, Rank.ChiefPettyOfficer, token, ChiefPettyOfficerBorderGradient), "Rank.chiefPettyOfficer.name"),
            new Swatch(Rank.SeniorChiefPettyOfficer, "Senior Chief Petty Officer", (token) => MonsterMaroonUniformPack.decorateRankSwatch(SeniorChiefPettyOfficerRank, Rank.SeniorChiefPettyOfficer, token, SeniorChiefPettyOfficerBorderGradient), "Rank.seniorChiefPettyOfficer.name"),
        ];
    }

    getRankIndicator(token: Token) {
        if (token.variant === UniformVariantType.Base) {
            switch (token.rankIndicator) {
                case Rank.Ensign:
                    return MonsterMaroonEnsign;
                case Rank.LieutenantJG:
                    return MonsterMaroonLieutenantJG;
                case Rank.Lieutenant:
                    return MonsterMaroonLieutenant;
                case Rank.LtCommander:
                    return MonsterMaroonLtCommander;
                case Rank.Commander:
                    return MonsterMaroonCommander;
                case Rank.Captain:
                    return MonsterMaroonCaptain;
                default:
                    return "";
            }
        } else {
            return "";
        }
    }

    getRankBorderDefinitions(token: Token, bordered: boolean) {
        if (token.rankIndicator === Rank.Ensign) {
            return MonsterMaroonSilverMetalGradient +
                MonsterMaroonEnsignGradient +
                (bordered ? MonsterMaroonEnsignBorderGradient : "");
        } else if (token.rankIndicator === Rank.LieutenantJG) {
            return MonsterMaroonSilverMetalGradient +
                MonsterMaroonLieutenantJGGradient +
                (bordered ? MonsterMaroonLieutenantJGBorderGradient : "");
        } else if (token.rankIndicator === Rank.Lieutenant) {
            return MonsterMaroonSilverMetalGradient +
                MonsterMaroonLieutenantGradient +
                (bordered ? MonsterMaroonLieutenantBorderGradient : "");
        } else if (token.rankIndicator === Rank.LtCommander) {
            return MonsterMaroonSilverMetalGradient +
                MonsterMaroonLtCommanderGradient +
                (bordered ? MonsterMaroonLtCommanderBorderGradient : "");
        } else if (token.rankIndicator === Rank.Commander) {
            return MonsterMaroonSilverMetalGradient +
                MonsterMaroonCommanderGradient +
                (bordered ? MonsterMaroonCommanderBorderGradient : "");
        } else if (token.rankIndicator === Rank.Captain) {
            return MonsterMaroonSilverMetalGradient +
                MonsterMaroonCaptainGradient +
                (bordered ? MonsterMaroonCaptainBorderGradient : "");

        } else if (token.rankIndicator === Rank.Crewman1stClass) {
            return MonsterMaroonSilverMetalGradient +
                (bordered ? Crewman1stClassBorderGradient : "");
        } else if (token.rankIndicator === Rank.PettyOfficer2ndClass) {
            return MonsterMaroonSilverMetalGradient +
                (bordered ? PettyOfficer2ndClassBorderGradient : "");
        } else if (token.rankIndicator === Rank.PettyOfficer1stClass) {
            return MonsterMaroonSilverMetalGradient +
                (bordered ? PettyOfficer1stClassBorderGradient : "");
        } else if (token.rankIndicator === Rank.ChiefPettyOfficer) {
            return MonsterMaroonSilverMetalGradient +
                (bordered ? ChiefPettyOfficerBorderGradient : "");
        } else if (token.rankIndicator === Rank.SeniorChiefPettyOfficer) {
            return MonsterMaroonSilverMetalGradient +
                (bordered ? SeniorChiefPettyOfficerBorderGradient : "");
        } else {
            return "";
        }
    }

    getRankBorderIndicator(token: Token) {
        let strap = isEnlistedRank(token.rankIndicator) ? "" : MonsterMaroonBorderStrap.replace(DefaultRed, token.divisionColor);
        let rank = "";
        switch (token.rankIndicator) {
            case Rank.Ensign:
                rank = MonsterMaroonEnsignBorder;
                break;
            case Rank.LieutenantJG:
                rank = MonsterMaroonLieutenantJGBorder;
                break;
            case Rank.Lieutenant:
                rank = MonsterMaroonLieutenantBorder;
                break;
            case Rank.LtCommander:
                rank = MonsterMaroonLtCommanderBorder;
                break;
            case Rank.Commander:
                rank = MonsterMaroonCommanderBorder;
                break;
            case Rank.Captain:
                rank = MonsterMaroonCaptainBorder;
                break;
            case Rank.Crewman1stClass:
                rank = Crewman1stClassBorderRank;
                break;
            case Rank.PettyOfficer2ndClass:
                rank = PettyOfficer2ndClassRank;
                break;
            case Rank.PettyOfficer1stClass:
                rank = PettyOfficer1stClassRank;
                break;
            case Rank.ChiefPettyOfficer:
                rank = ChiefPettyOfficer;
                break;
            case Rank.SeniorChiefPettyOfficer:
                rank = SeniorChiefPettyOfficerRank;
                break;
            case Rank.None:
            case Rank.Crewman3rdClass:
            case Rank.Crewman2ndClass:
            default:
                strap = "";
                rank = "";
        }
        return strap + rank;
    }

    getUniformAndVariantBody(token: Token) {
        let result = "";
        let neck = this.getNeck(token.bodyType, token.skinColor, token.species, UniformEra.MonsterMaroon)
        if (token.bodyType === BodyType.AverageMale) {
            switch (token.variant) {
                case UniformVariantType.Variant1:
                    result = MonsterMaroon.averageMaleMedicalBody;
                    break;
                case UniformVariantType.Variant2:
                    result = MonsterMaroon.averageMaleExcursionJacket;
                    break;

                default:
                    result = this.isEnlisted(token) ? MonsterMaroon.averageMaleBodyEnlisted : MonsterMaroon.averageMaleBody;
            }
        } else {
            switch (token.variant) {
                case UniformVariantType.Variant1:
                    result = MonsterMaroon.averageFemaleMedicalBody;
                    break;
                case UniformVariantType.Variant2:
                    result = MonsterMaroon.averageFemaleExcursionJacket;
                    break;

                default:
                    result = this.isEnlisted(token) ? MonsterMaroon.averageFemaleEnlistedBody : MonsterMaroon.averageFemaleBody;
            }
        }
        let finalResult = (neck + result).replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        return DivisionColors.getDivision(UniformEra.MonsterMaroon, token.divisionColor) === "Trainee" ? finalResult.replace(/#2d2d2d/g, token.divisionColor) : finalResult;
    }

    getUniformVariantSwatches(token: Token) {
        if (token.bodyType === BodyType.AverageFemale) {
            let result = [
                new Swatch(UniformVariantType.Base, "Base", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.MonsterMaroon)
                    + (this.isEnlisted(token) ? MonsterMaroon.averageFemaleEnlistedBody : MonsterMaroon.averageFemaleBody), 100000 + UniformVariantType.Base, token)),
            ];
            if (DivisionColors.getDivision(UniformEra.MonsterMaroon, token.divisionColor) === "Medical") {
                result.push(new Swatch(UniformVariantType.Variant1, "Medical", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.MonsterMaroon)
                    + MonsterMaroon.averageFemaleMedicalBody, 100000 + UniformVariantType.Variant1, token)));
            }
            result.push(new Swatch(UniformVariantType.Variant2, "Excursion Jacket", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.MonsterMaroon)
                + MonsterMaroon.averageFemaleExcursionJacket, 100000 + UniformVariantType.Variant2, token)));
            return result;
        } else if (token.bodyType === BodyType.AverageMale) {
            let result = [
                new Swatch(UniformVariantType.Base, "Base", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.MonsterMaroon)
                    + (this.isEnlisted(token) ? MonsterMaroon.averageMaleBodyEnlisted : MonsterMaroon.averageMaleBody), 100000 + UniformVariantType.Base, token)),
            ];
            if (DivisionColors.getDivision(UniformEra.MonsterMaroon, token.divisionColor) === "Medical") {
                result.push(
                    new Swatch(UniformVariantType.Variant1, "Medical", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.MonsterMaroon)
                    + MonsterMaroon.averageMaleMedicalBody, 100000 + UniformVariantType.Variant1, token))
                );
            }

            result.push(new Swatch(UniformVariantType.Variant2, "Excursion Jacket", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.MonsterMaroon)
                + MonsterMaroon.averageMaleExcursionJacket, 100000 + UniformVariantType.Variant2, token)));

            return result;
        } else {
            return [];
        }
    }

    isEnlisted(token: Token) {
        return isEnlistedRank(token.rankIndicator);
    }

    static decorateUniformSwatch(svg: string, clipPathId: number, token: Token) {
        let divisionSvg = svg.replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        if (isEnlistedRank(token.rankIndicator) && DivisionColors.getDivision(UniformEra.MonsterMaroon, token.divisionColor) === "Trainee") {
            divisionSvg = divisionSvg.replace(/#2d2d2d/g, token.divisionColor);
        }

        let result = `<svg viewBox="0 0 300 300" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <defs>
                    <clipPath id="clipPath` + clipPathId + `">
                        <circle cx="150" cy="150" r="150" fill="#ffffff" />
                    </clipPath>
                </defs>
                <g clip-path="url(#clipPath` + clipPathId + `">
                    <g transform="translate(-70, -130)">`
                    + divisionSvg
                + `</g>
                </g>
            </svg>`;
        return result;
    }


    getBorderColor(token: Token) {
        return "#700000";
    }


    static decorateRankSwatch(svg: string, rankIndicator: Rank, token: Token, gradient: string = "") {
        let gradientKey = 'rank' + Rank[rankIndicator] + "Gradient";
            return `<svg viewBox="0 0 130 130" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
            <defs>`
                + MonsterMaroonSilverMetalGradient.replace(new RegExp("silverMetalGradient", 'g'), "silverMetalGradient" + rankIndicator)
                + gradient.replace(new RegExp(gradientKey, 'g'), gradientKey + "Swatch" + rankIndicator).replace(new RegExp("silverMetalGradient", 'g'), "silverMetalGradient" + rankIndicator)
            + `</defs>`
            + (isEnlistedRank(rankIndicator) ? `<g transform="translate(17, -251)">` : `<g transform="translate(22, -211)">`)
            + svg.replace(new RegExp(gradientKey, 'g'), gradientKey + "Swatch" + rankIndicator)
            + `</g>
            </svg>`;
    }

    getBorderLogo(token: Token): string {
        return TwokDelta;
    }

    isDivisionColorSupported(token: Token): boolean {
        return true;
    }
}